		) external;
		function swapExactETHForTokensSupportingFeeOnTransferTokens(
			uint amountOutMin,
			address[] calldata path,
			address to,
			uint deadline
		) external payable;
		function swapExactTokensForETHSupportingFeeOnTransferTokens(
			uint amountIn,
			uint amountOutMin,
			address[] calldata path,
			address to,
			uint deadline
		) external;
}","keccak256":"0xcf790f9abba3a1b2d02a496a70c4a711e3aab15de969442d384ed14abe6046cd","license":"UNLICENSED"}},"version":1}

